var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n c \n', 'tags': '', 'url': 'Develop.html'}, {'title': '每周進度', 'text': '', 'tags': '', 'url': '每周進度.html'}, {'title': 'W1', 'text': '了解學期進度 \n', 'tags': '', 'url': 'W1.html'}, {'title': 'W2', 'text': '進行繪圖練習 \n 繪圖題目 \n \n 我負責繪製1-15題', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '繪圖作業 \n \n ▲零件一 \n \n ▲零件二 \n \n ▲零件三 \n \n ▲零件四 \n \n ▲零件五 \n \n ▲零件六 \n \n ▲零件七 \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': 'API \n 是指應用程式介面 ，是一種計算介面 ，它定義多個軟體 之間的互動 。更有提供擴充機制 ，以便使用者可以通過不同方法對現有功能進行不同的擴充 。一個API可以是完全客製化的，針對某個組件的，也可以是基於行業標準設計的以確保互操作性 ，API實現了模組化編程 ，從而允許使用者實現獨立地使用介面。 \n INVENTOR API \n Inventor API 目前是COM的形式。因此任何支援COM的語言都能使用，例如C++,VB, C#, VB.NET, Java, Delphi等等。由於微軟已經不再提供VBA的授權，Autodesk也計劃在未來的版本不再提供VBA。目前雖然Inventor中的VBA環境尚未去除，但我們還是建議大家學習就從.NET開始，因為不確定未來什麼時候InventorVBA也去除了。而且本文提到的很多課程都是用.NET進行介紹。當然，如果你擅長用其它語言，例如C++,Java，Delphi也行。', 'tags': '', 'url': 'W5.html'}, {'title': 'Meeting', 'text': '', 'tags': '', 'url': 'Meeting.html'}, {'title': '第十周', 'text': "\n 重點摘要 \n 進行工作了解並分配各自任務 \n 工作大致分為三類,並'ㄤ組別分為三小組 (程式組、機構組和繪圖組) \n", 'tags': '', 'url': '第十周.html'}, {'title': '第十一周', 'text': '\n 內容摘要 \n 將預訂目標內容(高爾夫球軌道)更改為較簡單的題目,機構5人 程式5人 繪圖5人 \n 機構組要盡快完成任務以利程式組進行 \n', 'tags': '', 'url': '第十一周.html'}, {'title': '第十二周', 'text': '\n 內容摘要 \n 同時進行兩種不同難度的題目,使深度與成品兼顧 \n 提出目前研究方向問題,討論解決方案 \n 目標本週使球體能順利於軌道行進 \n \n', 'tags': '', 'url': '第十二周.html'}, {'title': '第十三周', 'text': '\n 內容摘要 \n 已經可以成功模擬,但仍有小瑕疵(需要修改圖的小bug) \n 例:高爾夫球台高度需增加否則球會卡住 \n 進入較深的題目', 'tags': '', 'url': '第十三周.html'}, {'title': '第十四周', 'text': '\n 內容摘要 \n 改成有畫面的圖直播了,訂定新型機構的參考範本(如下圖) \n', 'tags': '', 'url': '第十四周.html'}, {'title': '第十五周', 'text': '\n 內容摘要 \n 檢視新型機構作動(如下圖),嘗試用pyslvs繪製連桿機構 \n', 'tags': '', 'url': '第十五周.html'}, {'title': 'hw2', 'text': 'https://drive.google.com/drive/folders/1NpjGqfvnlCdWpsHJ1ddzEVM22b3LsOgo?usp=sharing \n 零件一 \n \n 零件二 \n \n 零件三 \n \n 零件四 \n \n 零件五 \n \n 零件六 \n \n 零件七 \n \n 零件八 \n \n 零件九 \n \n 零件十 \n', 'tags': '', 'url': 'hw2.html'}]};